import React from "react";
import "./Weather.css";

function Weather(props) {
  return (
    <div className="weather">
      <h3 className="day">{props.name}</h3>
      <p>Paragraph</p>
      <span>
        <h3 className="high">high</h3>
        <h3 className="low">low</h3>
      </span>
    </div>
  );
}

export default Weather;
